// 【起始江湖】
//
// 天下英雄谁人识？今朝论剑排天下！
// 主功便是『快速排序』大阵，乃是以『枢轴』一划为界的精妙功夫！

function quickSort(arr) {
  // 按江湖规矩行事：数组长度若仅有一物，则不必再动。
  if (arr.length <= 1) return arr;

  // 找得阵法中的『枢轴』，即为数组第一之『元素』！
  const pivot = arr[0];
  // 定下两道江湖门派：『左边门派』与『右边门派』！
  const left = [];
  const right = [];

  // 循环遍历『大阵』之中之『元素』，乃是要分清左右门派！
  for (let i = 1; i < arr.length; i++) {
    // 若是元素值小于枢轴，则归于『左边门派』中。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else { // 不满足上式条件者，自然便该归入『右边门派』。
      right.push(arr[i]);
    }
  }

  // 组合两大阵法之中之元素：以左阵为首，中以『枢轴』为中坚，再右以右派殿后！
  return [...quickSort(left), pivot, ...quickSort(right)];
}
